) Usare con cautela nei pazienti con malattie cardiovascolari o con una storia famigliare di prolungamento QT. Effettuare un ECG di base prima di iniziare il trattamento (vedi paragrafo 4.3). Effettuare un monitoraggio dell’ECG nel corso della terapia, sulla base delle condizioni cliniche del paziente. Nel corso della terapia, ridurre il dosaggio se si osserva un prolungamento del QT e interrompere se il QTc è >500ms. Si raccomanda un controllo periodico degli elettroliti. Evitare una terapia concomitante con altri neurolettici. Cinetica di risposta/sospensione Nella schizofrenia, la risposta ai trattamenti con farmaci antipsicotici può essere ritardata. Se la terapia farmacologica viene interrotta, i sintomi della schizofrenia possono non riapparire per diverse settimane o mesi. Dopo l’interruzione improvvisa dell’assunzione di alte dosi di farmaci antipsicotici, sono stati descritti molto raramente sintomi acuti da sospensione, quali: nausea, vomito, segni transitori di discinesia ed insonnia. E’ consigliabile, pertanto, una sospensione graduale della terapia. Sintomi extrapiramidali Come con tutti gli altri neurolettici, possono comparire sintomi extrapiramidali (vedere paragrafo 4.8). E’ possibile prescrivere al bisogno farmaci antiparkinson di tipo anticolinergico, ma questi non possono essere prescritti abitualmente come misura preventiva. Discinesia tardiva Come con tutti gli antipsicotici, può comparire discinesia tardiva in alcuni pazienti in terapia a lungo termine o dopo interruzione del farmaco. La sindrome è caratterizzata prevalentemente da movimenti ritmici involontari della lingua, della faccia, della bocca o della mandibola. Le manifestazioni possono essere permanenti in alcuni pazienti. La sindrome può essere mascherata quando si riprende il trattamento, quando il dosaggio viene aumentato o in caso di switch ad un diverso antipsicotico. Il trattamento deve essere interrotto prima possibile. Sindrome Neurolettica Maligna Come con altri farmaci antipsicotici, ORAP è stato associato a un complesso di sintomi, potenzialmente fatale, denominato Sindrome Neurolettica Maligna. Manifestazioni cliniche di Agenzia Italiana del Farmaco Documento reso disponibile da AIFA il 13/09/2024
Esula dalla competenza dell’AIFA ogni eventuale disputa concernente i diritti di proprietà industriale e la tutela brevettuale dei dati relativi all’AIC dei medicinali e, pertanto, l’Agenzia non può essere ritenuta responsabile in alcun modo di eventuali violazioni da parte del titolare dell'autorizzazione all'immissione in commercio (o titolare AIC). -4- tale sindrome sono: iperpiressia, rigidità muscolare, acinesia, disturbi vegetativi (irregolarità del polso e della pressione arteriosa, sudorazione, tachicardia, aritmie); alterazioni dello stato di coscienza che possono progredire fino allo stupore e al coma. L’ipertermia è spesso un segno precoce di questa sindrome. Il trattamento della S.N.M. consiste nel sospendere immediatamente la somministrazione dei farmaci antipsicotici e di altri farmaci non essenziali e nell'istituire una terapia sintomatica intensiva (particolare cura deve essere posta nel ridurre l'ipertermia e nel correggere la disidratazione). Qualora venisse ritenuta indispensabile la ripresa del trattamento con antipsicotici, il paziente deve essere attentamente monitorato. Crisi epilettiche Come altri antipsicotici, ORAP deve essere usato con cautela in pazienti con una storia di crisi epilettiche o altre condizioni potenzialmente in grado di abbassare la soglia convulsiva. Inoltre, sono state riportate in associazione ad ORAP convulsioni di tipo grande male. Regolazione della temperatura corporea Agli agenti antipsicotici è stato attribuito l’annullamento della capacità dell’organismo di ridurre la temperatura corporea. E’ opportuno prestare attenzione nei casi in cui la pimozide venga prescritta a pazienti che potranno essere sottoposti a condizioni che contribuiscono ad innalzare la temperatura corporea, ad esempio allenamenti intensi, esposizione a calore elevato, concomitante somministrazione di farmaci ad azione anticolinergica, o tendenza alla disidratazione. Effetti endocrini Gli effetti ormonali dei farmaci antipsicotici neurolettici includono: iperprolattinemia, che può causare galattorrea, ginecomastia, oligomenorrea o amenorrea, e disfunzione erettile. Sono stati riportati casi di tromboembolismo venoso (TEV) con farmaci antipsicotici. Spesso i pazienti trattati con farmaci antipsicotici presentano fattori di rischio acquisiti per TEV; pertanto devono essere identificati tutti i possibili fattori di rischio per TEV prima e durante la terapia con ORAP e devono essere intraprese misure preventive. In studi clinici randomizzati versus placebo condotti in una popolazione di pazienti con demenza trattati con alcuni antipsicotici atipici è stato osservato un aumento di circa tre volte del rischio di eventi cerebrovascolari. Il meccanismo di tale aumento del rischio non è noto. Non può essere escluso un aumento del rischio per altri antipsicotici o in altre popolazioni di pazienti. ORAP deve essere usato con cautela in pazienti con fattori di rischio per stroke. Con uguale cautela andrà intrapresa la terapia con ORAP in pazienti anziani, in ragione della maggiore sensibilità al farmaco ed in quelli con insufficienza epatica e/o renale per il rischio di accumulo, e negli individui le cui condizioni possono essere aggravate dall'azione anticolinergica della pimozide. Aumento della mortalità nelle persone anziane con demenza Nei pazienti anziani con psicosi correlata alla demenza trattati con antipsicotici il rischio di morte è aumentato. Dall’analisi di diciassette studi controllati verso placebo (durata modale di 10 settimane), nei pazienti trattati con antipsicotici atipici è stato evidenziato un aumento della mortalità da 1.6 a 1.7 volte rispetto ai pazienti trattati con placebo. Nel corso di uno studio controllato della durata di 10 settimane, è stata osservata una incidenza della mortalità di circa il 4.5% nei pazienti trattati con il farmaco rispetto al tasso di circa il 2.6% del gruppo placebo. Anche se le cause di morte sono state varie, la maggior parte di queste sono state di natura cardiovascolare (ad esempio insufficienza cardiaca, morte improvvisa) o di natura infettiva (ad esempio polmonite). Gli studi osservazionali hanno mostrato che, in modo simile agli Agenzia Italiana del Farmaco Documento reso disponibile da AIFA il 13/09/2024
Esula dalla competenza dell’AIFA ogni eventuale disputa concernente i diritti di proprietà industriale e la tutela brevettuale dei dati relativi all’AIC dei medicinali e, pertanto, l’Agenzia non può essere ritenuta responsabile in alcun modo di eventuali violazioni da parte del titolare dell'autorizzazione all'immissione in commercio (o titolare AIC). -5- antipsicotici atipici, il trattamento con antipsicotici convenzionali può aumentare il rischio di morte. Non è chiara la misura in cui l’aumento della mortalità rilevato negli studi osservazionali possa essere attribuito al farmaco antipsicotico piuttosto che ad alcune caratteristiche dei pazienti. ORAP non è autorizzato per il trattamento dei disturbi del comportamento correlati a demenza.
